# This method is used to create a person
def createPerson(persongroupname,strpersonName):
    try:
        createperson_fullurl = commonfaceurl + "persongroups/" + persongroupname + "/persons"
        response = requests.post(createperson_fullurl, headers=headers, json={"name": strpersonName })
        personId = ""
        if response.status_code == 200:
            faces = response.json()
            personId = faces['personId']
        return personId
    except Exception as e:
        print(e)

